import React, { Component } from 'react'
import axios from 'axios';

export default class Posts extends Component {
  componentDidMount(){
    axios.get('https://jsonplaceholder.typicode.com/posts')
    .then(res => {
        console.log(res)
    })
    .then(data => console.log(data));
  }

  render() {
    return (
      <div>
        <h1>Posts</h1>
      </div>
    )
  }
}
